import React, {Component} from 'react';
import {Container} from 'react-bootstrap';
import Top from './Top';

class App extends Component {
  render(){
  return (
    <div>
      <Top/>
    <Container>
      <p>Hallo Bootstrap</p>
    </Container>
    </div>
  );
}
}

export default App;
